@testset "3.4 u (a+b log(c (d+e x^m)^n))^p" begin
    (a, b, c, d, e, f, g, h, m, n, p, q, x, ) = @variables a b c d e f g h m n p q x

    #= ::Package:: =#

    #= ::Title::Closed:: =#
    #=Integrands*of*the*form*u*log(c*(d+e*x^m)^n)^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(f*x)^q*log(c*(d+e*x^m)^n)=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^q*log(c*(d+e*x^m)^n)=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [x^4*log(c*(a + b*x^2)^p), x, 4, -((2*a^2*p*x)/(5*b^2)) + (2*a*p*x^3)/(15*b) - (2*p*x^5)/25 + (2*a^(5/2)*p*atan((sqrt(b)*x)/sqrt(a)))/(5*b^(5/2)) + (1/5)*x^5*log(c*(a + b*x^2)^p)]
    @test_int [x^3*log(c*(a + b*x^2)^p), x, 4, (a*p*x^2)/(4*b) - (p*x^4)/8 - (a^2*p*log(a + b*x^2))/(4*b^2) + (1/4)*x^4*log(c*(a + b*x^2)^p)]
    @test_int [x^2*log(c*(a + b*x^2)^p), x, 4, (2*a*p*x)/(3*b) - (2*p*x^3)/9 - (2*a^(3/2)*p*atan((sqrt(b)*x)/sqrt(a)))/(3*b^(3/2)) + (1/3)*x^3*log(c*(a + b*x^2)^p)]
    @test_int [x^1*log(c*(a + b*x^2)^p), x, 3, -((p*x^2)/2) + ((a + b*x^2)*log(c*(a + b*x^2)^p))/(2*b)]
    @test_int [x^0*log(c*(a + b*x^2)^p), x, 3, -2*p*x + (2*sqrt(a)*p*atan((sqrt(b)*x)/sqrt(a)))/sqrt(b) + x*log(c*(a + b*x^2)^p)]
    @test_int [log(c*(a + b*x^2)^p)/x^1, x, 3, (1/2)*log(-((b*x^2)/a))*log(c*(a + b*x^2)^p) + (1/2)*p*PolyLog(2, 1 + (b*x^2)/a)]
    @test_int [log(c*(a + b*x^2)^p)/x^2, x, 2, (2*sqrt(b)*p*atan((sqrt(b)*x)/sqrt(a)))/sqrt(a) - log(c*(a + b*x^2)^p)/x]
    @test_int [log(c*(a + b*x^2)^p)/x^3, x, 5, (b*p*log(x))/a - ((a + b*x^2)*log(c*(a + b*x^2)^p))/(2*a*x^2), (b*p*log(x))/a - (b*p*log(a + b*x^2))/(2*a) - log(c*(a + b*x^2)^p)/(2*x^2)]
    @test_int [log(c*(a + b*x^2)^p)/x^4, x, 3, -((2*b*p)/(3*a*x)) - (2*b^(3/2)*p*atan((sqrt(b)*x)/sqrt(a)))/(3*a^(3/2)) - log(c*(a + b*x^2)^p)/(3*x^3)]
    @test_int [log(c*(a + b*x^2)^p)/x^5, x, 4, -((b*p)/(4*a*x^2)) - (b^2*p*log(x))/(2*a^2) + (b^2*p*log(a + b*x^2))/(4*a^2) - log(c*(a + b*x^2)^p)/(4*x^4)]
    @test_int [log(c*(a + b*x^2)^p)/x^6, x, 4, -((2*b*p)/(15*a*x^3)) + (2*b^2*p)/(5*a^2*x) + (2*b^(5/2)*p*atan((sqrt(b)*x)/sqrt(a)))/(5*a^(5/2)) - log(c*(a + b*x^2)^p)/(5*x^5)]
    @test_int [log(c*(a + b*x^2)^p)/x^7, x, 4, -((b*p)/(12*a*x^4)) + (b^2*p)/(6*a^2*x^2) + (b^3*p*log(x))/(3*a^3) - (b^3*p*log(a + b*x^2))/(6*a^3) - log(c*(a + b*x^2)^p)/(6*x^6)]


    @test_int [x^5*log(c*(a + b*x^3)^p), x, 4, (a*p*x^3)/(6*b) - (p*x^6)/12 - (a^2*p*log(a + b*x^3))/(6*b^2) + (1/6)*x^6*log(c*(a + b*x^3)^p)]
    @test_int [x^4*log(c*(a + b*x^3)^p), x, 9, (3*a*p*x^2)/(10*b) - (3*p*x^5)/25 + (sqrt(3)*a^(5/3)*p*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/(5*b^(5/3)) + (a^(5/3)*p*log(a^(1/3) + b^(1/3)*x))/(5*b^(5/3)) - (a^(5/3)*p*log(a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2))/(10*b^(5/3)) + (1/5)*x^5*log(c*(a + b*x^3)^p)]
    @test_int [x^3*log(c*(a + b*x^3)^p), x, 9, (3*a*p*x)/(4*b) - (3*p*x^4)/16 + (sqrt(3)*a^(4/3)*p*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/(4*b^(4/3)) - (a^(4/3)*p*log(a^(1/3) + b^(1/3)*x))/(4*b^(4/3)) + (a^(4/3)*p*log(a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2))/(8*b^(4/3)) + (1/4)*x^4*log(c*(a + b*x^3)^p)]
    @test_int [x^2*log(c*(a + b*x^3)^p), x, 3, -((p*x^3)/3) + ((a + b*x^3)*log(c*(a + b*x^3)^p))/(3*b)]
    @test_int [x^1*log(c*(a + b*x^3)^p), x, 8, -((3*p*x^2)/4) - (sqrt(3)*a^(2/3)*p*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/(2*b^(2/3)) - (a^(2/3)*p*log(a^(1/3) + b^(1/3)*x))/(2*b^(2/3)) + (a^(2/3)*p*log(a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2))/(4*b^(2/3)) + (1/2)*x^2*log(c*(a + b*x^3)^p)]
    @test_int [x^0*log(c*(a + b*x^3)^p), x, 8, -3*p*x - (sqrt(3)*a^(1/3)*p*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/b^(1/3) + (a^(1/3)*p*log(a^(1/3) + b^(1/3)*x))/b^(1/3) - (a^(1/3)*p*log(a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2))/(2*b^(1/3)) + x*log(c*(a + b*x^3)^p)]
    @test_int [log(c*(a + b*x^3)^p)/x^1, x, 3, (1/3)*log(-((b*x^3)/a))*log(c*(a + b*x^3)^p) + (1/3)*p*PolyLog(2, 1 + (b*x^3)/a)]
    @test_int [log(c*(a + b*x^3)^p)/x^2, x, 7, -((sqrt(3)*b^(1/3)*p*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/a^(1/3)) - (b^(1/3)*p*log(a^(1/3) + b^(1/3)*x))/a^(1/3) + (b^(1/3)*p*log(a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2))/(2*a^(1/3)) - log(c*(a + b*x^3)^p)/x]
    @test_int [log(c*(a + b*x^3)^p)/x^3, x, 7, -((sqrt(3)*b^(2/3)*p*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/(2*a^(2/3))) + (b^(2/3)*p*log(a^(1/3) + b^(1/3)*x))/(2*a^(2/3)) - (b^(2/3)*p*log(a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2))/(4*a^(2/3)) - log(c*(a + b*x^3)^p)/(2*x^2)]
    @test_int [log(c*(a + b*x^3)^p)/x^4, x, 5, (b*p*log(x))/a - (b*p*log(a + b*x^3))/(3*a) - log(c*(a + b*x^3)^p)/(3*x^3)]
    @test_int [log(c*(a + b*x^3)^p)/x^5, x, 8, -((3*b*p)/(4*a*x)) + (sqrt(3)*b^(4/3)*p*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/(4*a^(4/3)) + (b^(4/3)*p*log(a^(1/3) + b^(1/3)*x))/(4*a^(4/3)) - (b^(4/3)*p*log(a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2))/(8*a^(4/3)) - log(c*(a + b*x^3)^p)/(4*x^4)]
    @test_int [log(c*(a + b*x^3)^p)/x^6, x, 8, -((3*b*p)/(10*a*x^2)) + (sqrt(3)*b^(5/3)*p*atan((a^(1/3) - 2*b^(1/3)*x)/(sqrt(3)*a^(1/3))))/(5*a^(5/3)) - (b^(5/3)*p*log(a^(1/3) + b^(1/3)*x))/(5*a^(5/3)) + (b^(5/3)*p*log(a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2))/(10*a^(5/3)) - log(c*(a + b*x^3)^p)/(5*x^5)]
    @test_int [log(c*(a + b*x^3)^p)/x^7, x, 4, -((b*p)/(6*a*x^3)) - (b^2*p*log(x))/(2*a^2) + (b^2*p*log(a + b*x^3))/(6*a^2) - log(c*(a + b*x^3)^p)/(6*x^6)]


    #= ::Subsubsection::Closed:: =#
    #=n<0=#


    @test_int [x^4*log(c*(a + b/x)^p), x, 4, -((b^4*p*x)/(5*a^4)) + (b^3*p*x^2)/(10*a^3) - (b^2*p*x^3)/(15*a^2) + (b*p*x^4)/(20*a) + (1/5)*x^5*log(c*(a + b/x)^p) + (b^5*p*log(b + a*x))/(5*a^5)]
    @test_int [x^3*log(c*(a + b/x)^p), x, 4, (b^3*p*x)/(4*a^3) - (b^2*p*x^2)/(8*a^2) + (b*p*x^3)/(12*a) + (1/4)*x^4*log(c*(a + b/x)^p) - (b^4*p*log(b + a*x))/(4*a^4)]
    @test_int [x^2*log(c*(a + b/x)^p), x, 4, -((b^2*p*x)/(3*a^2)) + (b*p*x^2)/(6*a) + (1/3)*x^3*log(c*(a + b/x)^p) + (b^3*p*log(b + a*x))/(3*a^3)]
    @test_int [x^1*log(c*(a + b/x)^p), x, 4, (b*p*x)/(2*a) + (1/2)*x^2*log(c*(a + b/x)^p) - (b^2*p*log(b + a*x))/(2*a^2)]
    @test_int [x^0*log(c*(a + b/x)^p), x, 3, x*log(c*(a + b/x)^p) + (b*p*log(b + a*x))/a]
    @test_int [log(c*(a + b/x)^p)/x^1, x, 3, (-log(c*(a + b/x)^p))*log(-(b/(a*x))) - p*PolyLog(2, 1 + b/(a*x))]
    @test_int [log(c*(a + b/x)^p)/x^2, x, 3, p/x - ((a + b/x)*log(c*(a + b/x)^p))/b]
    @test_int [log(c*(a + b/x)^p)/x^3, x, 4, p/(4*x^2) - (a*p)/(2*b*x) + (a^2*p*log(a + b/x))/(2*b^2) - log(c*(a + b/x)^p)/(2*x^2)]
    @test_int [log(c*(a + b/x)^p)/x^4, x, 4, p/(9*x^3) - (a*p)/(6*b*x^2) + (a^2*p)/(3*b^2*x) - (a^3*p*log(a + b/x))/(3*b^3) - log(c*(a + b/x)^p)/(3*x^3)]
    @test_int [log(c*(a + b/x)^p)/x^5, x, 4, p/(16*x^4) - (a*p)/(12*b*x^3) + (a^2*p)/(8*b^2*x^2) - (a^3*p)/(4*b^3*x) + (a^4*p*log(a + b/x))/(4*b^4) - log(c*(a + b/x)^p)/(4*x^4)]


    @test_int [x^4*log(c*(a + b/x^2)^p), x, 5, -((2*b^2*p*x)/(5*a^2)) + (2*b*p*x^3)/(15*a) + (2*b^(5/2)*p*atan((sqrt(a)*x)/sqrt(b)))/(5*a^(5/2)) + (1/5)*x^5*log(c*(a + b/x^2)^p)]
    @test_int [x^3*log(c*(a + b/x^2)^p), x, 5, (b*p*x^2)/(4*a) + (1/4)*x^4*log(c*(a + b/x^2)^p) - (b^2*p*log(b + a*x^2))/(4*a^2)]
    @test_int [x^2*log(c*(a + b/x^2)^p), x, 4, (2*b*p*x)/(3*a) - (2*b^(3/2)*p*atan((sqrt(a)*x)/sqrt(b)))/(3*a^(3/2)) + (1/3)*x^3*log(c*(a + b/x^2)^p)]
    @test_int [x^1*log(c*(a + b/x^2)^p), x, 3, (1/2)*x^2*log(c*(a + b/x^2)^p) + (b*p*log(b + a*x^2))/(2*a)]
    @test_int [x^0*log(c*(a + b/x^2)^p), x, 3, (2*sqrt(b)*p*atan((sqrt(a)*x)/sqrt(b)))/sqrt(a) + x*log(c*(a + b/x^2)^p)]
    @test_int [log(c*(a + b/x^2)^p)/x^1, x, 3, (-(1/2))*log(c*(a + b/x^2)^p)*log(-(b/(a*x^2))) - (1/2)*p*PolyLog(2, 1 + b/(a*x^2))]
    @test_int [log(c*(a + b/x^2)^p)/x^2, x, 4, (2*p)/x + (2*sqrt(a)*p*atan((sqrt(a)*x)/sqrt(b)))/sqrt(b) - log(c*(a + b/x^2)^p)/x]
    @test_int [log(c*(a + b/x^2)^p)/x^3, x, 3, p/(2*x^2) - ((a + b/x^2)*log(c*(a + b/x^2)^p))/(2*b)]
    @test_int [log(c*(a + b/x^2)^p)/x^4, x, 5, (2*p)/(9*x^3) - (2*a*p)/(3*b*x) - (2*a^(3/2)*p*atan((sqrt(a)*x)/sqrt(b)))/(3*b^(3/2)) - log(c*(a + b/x^2)^p)/(3*x^3)]


    @test_int [log(1 + b/x)/x, x, 1, PolyLog(2, -b/x)]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^q*log(c*(d+e*x^(m/2))^n)=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [x^3*log(c*(a + b*sqrt(x))^p), x, 4, (a^7*p*sqrt(x))/(4*b^7) - (a^6*p*x)/(8*b^6) + (a^5*p*x^(3/2))/(12*b^5) - (a^4*p*x^2)/(16*b^4) + (a^3*p*x^(5/2))/(20*b^3) - (a^2*p*x^3)/(24*b^2) + (a*p*x^(7/2))/(28*b) - (p*x^4)/32 - (a^8*p*log(a + b*sqrt(x)))/(4*b^8) + (1/4)*x^4*log(c*(a + b*sqrt(x))^p)]
    @test_int [x^2*log(c*(a + b*sqrt(x))^p), x, 4, (a^5*p*sqrt(x))/(3*b^5) - (a^4*p*x)/(6*b^4) + (a^3*p*x^(3/2))/(9*b^3) - (a^2*p*x^2)/(12*b^2) + (a*p*x^(5/2))/(15*b) - (p*x^3)/18 - (a^6*p*log(a + b*sqrt(x)))/(3*b^6) + (1/3)*x^3*log(c*(a + b*sqrt(x))^p)]
    @test_int [x^1*log(c*(a + b*sqrt(x))^p), x, 4, (a^3*p*sqrt(x))/(2*b^3) - (a^2*p*x)/(4*b^2) + (a*p*x^(3/2))/(6*b) - (p*x^2)/8 - (a^4*p*log(a + b*sqrt(x)))/(2*b^4) + (1/2)*x^2*log(c*(a + b*sqrt(x))^p)]
    @test_int [x^0*log(c*(a + b*sqrt(x))^p), x, 4, (a*p*sqrt(x))/b - (p*x)/2 - (a^2*p*log(a + b*sqrt(x)))/b^2 + x*log(c*(a + b*sqrt(x))^p)]
    @test_int [log(c*(a + b*sqrt(x))^p)/x^1, x, 3, 2*log(c*(a + b*sqrt(x))^p)*log(-((b*sqrt(x))/a)) + 2*p*PolyLog(2, 1 + (b*sqrt(x))/a)]
    @test_int [log(c*(a + b*sqrt(x))^p)/x^2, x, 4, -((b*p)/(a*sqrt(x))) + (b^2*p*log(a + b*sqrt(x)))/a^2 - log(c*(a + b*sqrt(x))^p)/x - (b^2*p*log(x))/(2*a^2)]
    @test_int [log(c*(a + b*sqrt(x))^p)/x^3, x, 4, -((b*p)/(6*a*x^(3/2))) + (b^2*p)/(4*a^2*x) - (b^3*p)/(2*a^3*sqrt(x)) + (b^4*p*log(a + b*sqrt(x)))/(2*a^4) - log(c*(a + b*sqrt(x))^p)/(2*x^2) - (b^4*p*log(x))/(4*a^4)]
    @test_int [log(c*(a + b*sqrt(x))^p)/x^4, x, 4, -((b*p)/(15*a*x^(5/2))) + (b^2*p)/(12*a^2*x^2) - (b^3*p)/(9*a^3*x^(3/2)) + (b^4*p)/(6*a^4*x) - (b^5*p)/(3*a^5*sqrt(x)) + (b^6*p*log(a + b*sqrt(x)))/(3*a^6) - log(c*(a + b*sqrt(x))^p)/(3*x^3) - (b^6*p*log(x))/(6*a^6)]


    #= ::Subsubsection:: =#
    #=n<0=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(f*x)^(q/2)*log(c*(d+e*x^(m/2))^n)=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [log(a + b*sqrt(x))/sqrt(x), x, 3, -2*sqrt(x) + (2*(a + b*sqrt(x))*log(a + b*sqrt(x)))/b]


    #= ::Subsubsection:: =#
    #=n<0=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(f*x)^q*log(c*(d+e*x^m)^n)*when*q*symbolic=#


    @test_int [(f*x)^m*log(c*(d + e*x^3)^p), x, 3, -((3*e*p*(f*x)^(4 + m)*HypergeometricFunctions._₂F₁(1, (4 + m)/3, (7 + m)/3, -((e*x^3)/d)))/(d*f^4*(1 + m)*(4 + m))) + ((f*x)^(1 + m)*log(c*(d + e*x^3)^p))/(f*(1 + m))]
    @test_int [(f*x)^m*log(c*(d + e*x^2)^p), x, 3, -((2*e*p*(f*x)^(3 + m)*HypergeometricFunctions._₂F₁(1, (3 + m)/2, (5 + m)/2, -((e*x^2)/d)))/(d*f^3*(1 + m)*(3 + m))) + ((f*x)^(1 + m)*log(c*(d + e*x^2)^p))/(f*(1 + m))]
    @test_int [(f*x)^m*log(c*(d + e*x^1)^p), x, 2, -((e*p*(f*x)^(2 + m)*HypergeometricFunctions._₂F₁(1, 2 + m, 3 + m, -((e*x)/d)))/(d*f^2*(1 + m)*(2 + m))) + ((f*x)^(1 + m)*log(c*(d + e*x)^p))/(f*(1 + m))]
    @test_int [(f*x)^m*log(c*(d + e/x^1)^p), x, 4, (e*p*(f*x)^m*HypergeometricFunctions._₂F₁(1, -m, 1 - m, -(e/(d*x))))/(d*m*(1 + m)) + ((f*x)^(1 + m)*log(c*(d + e/x)^p))/(f*(1 + m))]
    @test_int [(f*x)^m*log(c*(d + e/x^2)^p), x, 4, -((2*e*f*p*(f*x)^(-1 + m)*HypergeometricFunctions._₂F₁(1, (1 - m)/2, (3 - m)/2, -(e/(d*x^2))))/(d*(1 - m^2))) + ((f*x)^(1 + m)*log(c*(d + e/x^2)^p))/(f*(1 + m))]
    @test_int [(f*x)^m*log(c*(d + e/x^3)^p), x, 4, -((3*e*f^2*p*(f*x)^(-2 + m)*HypergeometricFunctions._₂F₁(1, (2 - m)/3, (5 - m)/3, -(e/(d*x^3))))/(d*(2 + m - m^2))) + ((f*x)^(1 + m)*log(c*(d + e/x^3)^p))/(f*(1 + m))]


    @test_int [(f*x)^m*log(c*(d + e*sqrt(x))^p), x, 4, If(13>=8, -((e*p*x^(3/2)*(f*x)^m*HypergeometricFunctions._₂F₁(1, 3 + 2*m, 2*(2 + m), -((e*sqrt(x))/d)))/(d*(3 + 5*m + 2*m^2))) + ((f*x)^(1 + m)*log(c*(d + e*sqrt(x))^p))/(f*(1 + m)), -((e*p*x^(3/2)*(f*x)^m*HypergeometricFunctions._₂F₁(1, 3 + 2*m, 2*(2 + m), -((e*sqrt(x))/d)))/(d*(1 + m)*(3 + 2*m))) + ((f*x)^(1 + m)*log(c*(d + e*sqrt(x))^p))/(f*(1 + m)))]
    @test_int [(f*x)^m*log(c*(d + e/sqrt(x))^p), x, 5, (p*x*(f*x)^m*HypergeometricFunctions._₂F₁(1, 2*(1 + m), 3 + 2*m, -((d*sqrt(x))/e)))/(2*(1 + m)^2) + ((f*x)^(1 + m)*log(c*(d + e/sqrt(x))^p))/(f*(1 + m))]


    #= ::Subsection::Closed:: =#
